import React, { useEffect, useState, useContext } from 'react';
import { Link } from 'react-router-dom';
import '../styles/Home.css';
import { getUserProfile } from '../services/api';
import { AuthContext } from '../context/AuthContext';

function Home() {
  const [userData, setUserData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const { user } = useContext(AuthContext);

  useEffect(() => {
    const fetchUserData = async () => {
      if (!user) {
        setLoading(false);
        return;
      }
      
      try {
        const data = await getUserProfile();
        setUserData(data);
      } catch (err) {
        console.error('Error fetching profile:', err);
        setError('Failed to load user data');
      } finally {
        setLoading(false);
      }
    };

    fetchUserData();
  }, [user]);

  if (!user) {
    return (
      <div className="home-container">
        <div className="welcome-section">
          <h1>Welcome to YourApp</h1>
          <p>Please login or signup to continue</p>
          <div className="cta-buttons">
            <Link to="/login" className="btn btn-primary">Login</Link>
            <Link to="/signup" className="btn btn-secondary">Sign Up</Link>
          </div>
        </div>
        
        <div className="features-section">
          <div className="feature">
            <h2>Real-time Chat</h2>
            <p>Connect with friends and chat instantly.</p>
          </div>
          <div className="feature">
            <h2>Secure & Private</h2>
            <p>Your conversations are secure and private.</p>
          </div>
          <div className="feature">
            <h2>Easy to Use</h2>
            <p>Simple, intuitive interface for seamless communication.</p>
          </div>
        </div>
      </div>
    );
  }

  if (loading) {
    return <div className="loading">Loading...</div>;
  }

  if (error) {
    return <div className="error-message">{error}</div>;
  }

  return (
    <div className="home-container">
      <div className="dashboard">
        <div className="welcome-header">
          <h1>Welcome, {user.fullName || user.email}!</h1>
          <p>You are now logged in to your account</p>
        </div>
        
        <div className="account-info">
          <h2>Your Account Information</h2>
          <div className="info-card">
            <p><strong>Name:</strong> {user.fullName || 'Not provided'}</p>
            <p><strong>Email:</strong> {user.email}</p>
            <p><strong>Member Since:</strong> {new Date().toLocaleDateString()}</p>
          </div>
        </div>
        
        <div className="quick-actions">
          <h2>Quick Actions</h2>
          <div className="action-buttons">
            <Link to="/chat" className="action-btn">Start Chatting</Link>
            <button className="action-btn secondary">Update Profile</button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
